import React from 'react';
import airbnb from '../../images/airbnb.jpeg';

const index = () => {
    return (
            <div className='google'>
                <div>
                    <img
                        src={airbnb}
                        alt=""
                        width={35}
                        height={35}
                    />
                    <div className='airbnb'>
                        <h3>Google</h3>
                        <div>
                            <span>UX Design Lead, Next Billion Users</span>
                            <span>3 days ago <div /> 6 applied</span>
                        </div>
                    </div>
                </div>
                <span>Singapore</span>
            </div>
    )
}

export default index
